    false,nt"url": null,nt"notes": "The Fishery Management Plan for the Kenai
    National Wildlife Refuge for the Kenai National Wildlife Refuge provides management
    direction necessary to ensure conservation of refuge fishery resources and habitat,
    while maintaining sustainable harvests.  The Fishery Plan outlines the purposes
    for which the refuge is managed and a resultant planning direction is achieved through
    development of management objectives and specific tasks. The planning effort is
    designed to span a five year period at which time it will be updated.",nt"license_title":
